import React, { useEffect, useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { jwtDecode } from 'jwt-decode';
import axios from 'axios';

const HistorialCommits = () => {
  const token = localStorage.getItem('token');
  const userId = token ? jwtDecode(token).id : null;
  const navigate = useNavigate();

  const [commits, setCommits] = useState([]);

  useEffect(() => {
    const fetchCommits = async () => {
      try {
        const projectId = 'your_project_id'; // Reemplaza con el ID del proyecto actual
        const response = await axios.get(
          `http://localhost:5000/api/projects/${projectId}/commits`,
          {
            headers: { Authorization: `Bearer ${token}` },
          }
        );
        setCommits(response.data);
      } catch (error) {
        console.error('Error al obtener los commits:', error.message);
      }
    };

    fetchCommits();
  }, [token]);

  return (
    <div className="main-layout">
      {/* Sidebar */}
      <div className="sidebar">
        <h2>NetBurrito</h2>
        <ul>
          <li><Link to="/dashboard">Dashboard</Link></li>
          <li>
            <button
              onClick={() => navigate(-1)} // Navega a la página anterior
              className="search-button"
            >
              Regresar
            </button>
          </li>
        </ul>
      </div>

      {/* Contenido Principal */}
      <div className="main-content">
        <h1>Historial de Commits</h1>
        {commits.length > 0 ? (
          <div className="commit-list">
            {commits.map((commit) => (
              <div key={commit._id} className="commit-card">
                <p><strong>Mensaje:</strong> {commit.message}</p>
                <p><strong>Fecha:</strong> {new Date(commit.createdAt).toLocaleString()}</p>
              </div>
            ))}
          </div>
        ) : (
          <p>No hay commits disponibles.</p>
        )}
      </div>
    </div>
  );
};

export default HistorialCommits;
